import React from "react";

export default function Login() {
  function handleRegister() {
    fetch("http://localhost:3000/users/auth", {
      method: "POST",
      body: JSON.stringify({
        username: "test",
        password: "123456",
      }),
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then((res) => {
        return res.json();
      })
      .catch((error) => {
        console.log(error);
      });
  }

  return <div>login</div>;
}
